package com.hit.userms.model;import jakarta.persistence.*;import lombok.AllArgsConstructor;import lombok.Data;import lombok.NoArgsConstructor;@Entity@NoArgsConstructor@AllArgsConstructor@Datapublic class AddressEO {    @Id    @GeneratedValue(strategy = GenerationType.AUTO)    private Integer addressId;    private String addressLine1;    private String addressLine2;    private String city;    private String nearByLandMark;    private String state;    private String pinCode;    @ManyToOne    private UserEO userEO;}